import React, { useState } from "react";
import Button from "../../common/Button/Button";
import { Search } from "../../common/Svg/Svg";
import Cart from "../Cart/Cart";
import MenuList from "../MenuList/MenuList";
import cn from "classnames";
import "../Navigation/Navigation.scss";

export default function Navigation(props) {
    const [isOpened, setOpen] = useState(false);
    function menuOpen() {
        setOpen(!isOpened && true);
        console.log("here");
    }

    return (
        <nav className="navigation">
            <Button class={"navigation__hamburger hamburger"} onClick={menuOpen}>
                <i className="fas fa-bars"></i>
            </Button>
            {console.log(isOpened)}
            <MenuList class={"navigation__list" + (isOpened ? " navigation__list--open" : "")} />
            <div className="navigation__logo">CBD</div>
            <div className="navigation__func-block func-block">
                <Button class={"func-block__item button--func"}>
                    <span className="button-text">Login</span>
                </Button>
                <Button
                    class={"func-block__item button--func button--search"}>
                    <Search className={"search-svg"} />
                    <span className="button-text">Search</span>
                </Button>
                <Cart count={props.count} />
            </div>
        </nav>
    )
}
